import React from "react";

function Card() {
  return (
    <div className="card bg-dark text-white">
      <img src="https://picsum.photos/id/237/600" class="card-img-top" alt="" />
      <div class="card-body">
        <h5 class="card-title">Haitam SKHAIRI</h5>
        <p class="card-text">
          Some quick example text to build on the card title and make up the
          bulk of the card's content.
        </p>
      </div>
    </div>
  );
}

export default Card;
